import Button from "./component/inputs/Button"
import {theme, ThemeProvider} from "styled-components"

const palette={
    primary : '#5C7CFA',
    warnning : 'rgb(92, 124, 250)'
}

function App () {
    return(
        <ThemeProvider theme={{palette}} color="warnning">
            <Button>버어튼</Button>
        </ThemeProvider>
    )
}

export default App
